export const services = {
    service_1: {
        name: 'Proyecto llave en mano',
        description:
            'Es un servicio destinado aquellos clientes que prefieren delegar  el desarrollo y construcción total del proyecto, minimizando los riesgos de una deficiente instalación,  concentrando los costos y responsabilidad en un solo proveedor.',
        imgURL: require('@/assets/services/proyectollave.jpg'),
    },
    service_2: {
        name: 'Asesorías',
