            'Disponemos de un departamento técnico que te ayudará a tomar las mejores decisiones de cómo proteger tus cultivos, con visitas en terreno con expertos asesores en producción de frutales.',
        imgURL: require('@/assets/services/asesorias.jpg'),
    },
    service_3: {
        name: 'Taller de Confección',
        description:
            'Experta y calificada mano de obra que garantiza una exitosa transformación de nuestros telares y plásticos con la finalidad de adaptarlos a cada requerimiento.',
        imgURL: require('@/assets/services/taller_confeccion.jpg'),
    },
    service_4: {
        name: 'Financiamiento',
        description:
            'Para financiar tus proyectos existen varios instrumentos financieros por parte de los Bancos y Organismos Gubernamentales. Fruteck te ayudará a que puedas obtener la mejor forma de acceder a ello.',
        imgURL: require('@/assets/services/financiamiento.jpg'),
    },
}
